import React from 'react';
import { PlusGrid, PlusGridItem, Text } from 'components';
import { Utils } from 'utils';
import styles from './banner.module.scss';

export const Banner = () => {

  const classes = Utils.classes({
    [styles.banner]: true,
  });

  return (
    <div className={classes}>
      <PlusGrid gutter="md">
        <PlusGridItem>
          <Text>
            Betisa
          </Text>
        </PlusGridItem>
        <PlusGridItem xs="grow" />
        <PlusGridItem>
          <Text size="label">
            See how HTML+ fits into the entire Betisa Ecosystem -&gt;
          </Text>
        </PlusGridItem>
        <PlusGridItem hide-xs>
          <Text>
            |
          </Text>
        </PlusGridItem>
        <PlusGridItem>
          <Text>
            BLACK LIVES MATTER
          </Text>
        </PlusGridItem>
      </PlusGrid>
    </div>
  );
};
